const Navbar = () => {
  return (
    <div className='flex flex-col w-full p-2 border-solid border-2 border-gray-500 absolute top-full right-0' >
      <ul className='w-full'>
        <li><a href='/'>Home</a></li>
        <li><a href='/Product'>Product</a></li>
        <li><a href='/Info'>Info</a></li>
      </ul>
    </div>
  );
}

export default Navbar;
